(1, 'हाम्रो बारेमा', 'hamro-barema', '<p style=\"text-align: center;\"><span style=\"color: #3f3f3f; font-family: Arial, Helvetica, sans-serif; font-size: 14pt;\"><span style=\"font-family: Preeti; font-size: 20pt; text-align: center; text-indent: 0.5in; color: #000000;\">lnlR5ljsfnLg vlkG5]F 6f]n Ps kl/ro</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.5in; line-height: normal; text-align: left;\"><span style=\"font-family: Preeti;\"><span style=\"font-size: 21.3333px;\">शक सम्बत ४५२ लिच्छवि राजा बसन्तदेवको पालामा स्थापना गरिएको जलद्रोणीको शिलालेखको आधारमा ललितपुर महानगरपालिका वडा नं ९ र १२ मा फैलिएको लिच्छविकालीन ज्यापु टोल हो ।&nbsp; आजको मितिले करिब १४८० वर्ष पुरानो लिखित इतिहास बोकेको खपिन्छेँ टोलको ऐतिहासिक एवं पुरातात्विक महत्व रहेको प्रसिद्ध श्री आकाश भैरब विराजमान रहेको छ । यस क्षेत्रका स्थानीय बासिन्दाहरुको आराध्य देवको रुपमा श्री आकाश भैरबलाई स्थानीय भाषामा भैलः आजुको नामले पुजिन्छ । यहाँ महर्जन, अवाले र ब्यञ्जनकार समुदायको बसोबास रहेको छ ।&nbsp;&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.5in; line-height: normal; text-align: left;\"><span style=\"font-family: Preeti;\"><span style=\"font-size: 21.3333px;\">९००० मूूर्तिहरुको मन्दिर भनेर विश्व विख्यात पाटन ओकुुबहाल स्थित महाबौद्ध मन्दिरसँग जोडिएको त्याग्माचा चिभाः अर्थात तेराकोटा चैत्यचिवाः खपिन्छेँ टोलमा रहेको छ । थान गणेश, नारायण मन्दिर, अन्य चैत्य, चोक, ईनार, पाटी पौवा, पोखरी आदिले खपिन्छेँ टोलको ऐतिहासिकता झल्किन्छ ।&nbsp;&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.5in; line-height: normal; text-align: left;\"><span style=\"font-family: Preeti;\"><span style=\"font-size: 21.3333px;\">खपिन्छेँ टोलको राजनैतिक पृष्ठभूमि हेर्दा नेपालको राष्ट्रिय राजनैतिक आन्दोलनलाई सहयोगी भूमिका खेलेको कुरा इतिहासले कहिल्यै बिर्सिदैन । राष्ट्रिय राजनीतिका श्रद्धय नेता पुष्लाल, तुुल्सीलाल अमात्य, मनमोहन अधिकारी जस्ता नेताहरुलाई भुुमिगत कालमा संरक्षण गरेको टोलको रुपमा गर्विलो इतिहास रहेको टोल हो । राजनैतिक सचेतना जागृत गर्ने गराउने उद्देश्य सहित तात्कालीन अवस्थामा टोलबासीहरुको मेहनतले वि.सं. २०२५ सालमा जन विजय पुस्तकालय् स्थापना भएको हो ।&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.5in; line-height: normal; text-align: left;\"><span style=\"font-family: Preeti;\"><span style=\"font-size: 21.3333px;\">नेवाः सभ्यता, कला संस्कृति एवं सामाजिक र साँस्कृतिक एकताको मेरुदण्डको रुपमा रहेको खपिन्छेँ मंका खलः त्यस अन्तर्गतको दाफा भजन र टोलमा विद्यमान मौलिक धार्मिक परम्पराको चलि आएको भैलाद्यः ब्वयेगु अर्थात आकाश भैरब प्रदर्शन, द्यःतिकेगु अर्थात देवता ताँस्ने, सरस्वती पूजा, गुंलापारु भोज जस्ता परम्परा आजसम्म पनि रहि आएको छ ।&nbsp;</span></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<div id=\"tap-translate\" style=\"text-align: center;\">&nbsp;</div>\r\n<div id=\"tap-translate\" style=\"text-align: center;\">&nbsp;</div>\r\n<div id=\"tap-translate\" style=\"text-align: center;\">&nbsp;</div>\r\n<div id=\"tap-translate\" style=\"text-align: center;\">&nbsp;</div>', 1, 1, 'features/Cx2mkViCqaJJR3DFC1sIaSx9Cgk0KmJgnHPRRitx.jpeg', '2017-07-02 20:36:31', '2022-02-26 04:44:53', 1, 0, 0),
