(36, 'खपिन्छेँ भवन निर्माण गर्न भौतिक तथा आर्थिक सहयोगको लागि हार्दिक अनुरोध गर्दछौं।', 'bhawan-nirman-sahayog', '<p style=\"margin-bottom: 0in; line-height: 100%; text-align: left;\" align=\"center\">&nbsp;</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%; text-align: left;\" align=\"center\">&nbsp;</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%; text-align: left;\" align=\"center\">&nbsp;</p>\r\n<p style=\"margin-bottom: 0in; line-height: 100%; text-align: left;\" align=\"center\"><span style=\"font-family: Preeti; font-size: 18pt;\">cfb/0fLo <span style=\"font-family: arial, helvetica, sans-serif; font-size: 11pt;\">टोलवसीहरु</span>&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"font-size: 18.0pt; line-height: 115%; font-family: Preeti;\">gd:sf/ .</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"font-family: arial, helvetica, sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"font-family: preeti; font-size: 14pt;\">&nbsp;खपिन्छेँ भवन निर्माण गर्न भौतिक तथा आर्थिक सहयोगको लागि हार्दिक अनुरोध गर्दछौं।</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\">&nbsp;</p>\r\n<p style=\"text-align: right;\"><span style=\"font-family: preeti; font-size: 14pt;\">राजमान अवाले</span></p>\r\n<p style=\"text-align: right;\"><span style=\"font-family: preeti; font-size: 18pt;\">cWoIf</span></p>\r\n<p style=\"text-align: right;\">&nbsp;</p>', 1, 1, 'features/0zc3gCOtDrDrWmqMNnH5yuJQbJHRRMkHyW0ok7fl.jpeg', '2017-08-02 20:00:58', '2021-08-03 09:45:08', 0, 0, 1),
(38, 'हार्दिक आग्रह', 'hardik-anurodh', '<p style=\"text-align: left;\" align=\"center\">&nbsp;</p>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"font-size: 14pt;\">खपिन्छेँको भौगोलिक, आर्थिक, मतदाता, जनसंख्या, भाषा, यातायात, शिक्षा, स्वास्थ्य</span><span style=\"font-size: 14pt;\">हरुको जानकारीमूलक तथ्याङ्कहरु यथासम्भव प्रस्तुत गर्ने जमर्काे गरेको छौं ।</span></p>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"font-size: 14pt;\">यस वेबमा रहेका तथ्याङ्कहरु आधिकारिक स्रोत एवं&nbsp;<span style=\"font-size: 18.6667px;\">खपिन्छेँ</span>&nbsp;कै सक्रियताबाट तयार पारिएको हुँदा सम्पूर्ण क्षेत्रलाई विस्तृत रुपमा समेट्न नसकिने तथ्य&nbsp;</span><span style=\"font-size: 14pt;\">सर्वविदितै छ । यो प्रयासबाट&nbsp;<span style=\"font-size: 18.6667px;\">खपिन्छेँ</span>&nbsp;सम्वन्धी विविध जानकारी, सूचना एवं तथ्याङ्कबाट अध्ययनकत्र्ता, विद्यार्थी एवं सम्बद्ध पक्ष लाभान्बित हुनेछन् भन्ने आशा गरिएको छ ।</span></p>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"font-size: 14pt;\">प्रस्तुत गरिएका तथ्याङ्कगत कुनै त्रुटिहरु र छुट हुन गएका महत्वपूर्ण सूचनाहरुको सही जानकारी उपलब्ध गराई सुधारका लागि आफ्नो सुझाव एवं प्रतिक्रिया पठाईदिन समस्त बासीहरुमा हार्दिक आग्रह गरेका छौं ।&nbsp;</span></p>\r\n<p style=\"text-align: left;\" align=\"center\">&nbsp;</p>\r\n<p style=\"text-align: right;\" align=\"center\"><span style=\"font-size: 14pt;\">राजमान अवाले</span></p>\r\n<p style=\"text-align: right;\" align=\"center\"><span style=\"font-size: 14pt;\">अध्यक्ष</span></p>\r\n<p style=\"text-align: right;\" align=\"center\">&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 1, NULL, '2017-08-04 08:13:23', '2022-02-26 04:45:28', 0, 0, 0),
