(4, 'घर  जग्गा  नामसारी सिफारिस', '<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">१) घर जग्गा नामसारी सम्बन्धी विस्तृत विवरण खुलेको निवेदन</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">२) निवेदकको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">३) मृतक र निवेदक विचको नाता प्रमाणित प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">४) जग्गा धनी प्रमाण पुर्जाको प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">५) सर्जमिन मुचुल्का गरी बुझ्नु पर्ने भए सर्जमिनमा साक्षी बस्नेको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>', '2017-07-19 09:44:20', '2017-07-19 09:44:20'),
(5, 'मोही लगत कट्टा सिफारिस', '<p><span style=\"color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif; text-align: justify; font-size: 14pt;\">१) मोही लगत कट्टा हुनुपर्ने पूर्ण विवरणको निवेदन</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">२) निवेदकको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">३) जग्गाधनी प्रमाण पुर्जाको प्रमाणित प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">४) जग्गाको प्रमाणित नापी नक्सा</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">५) चालु आ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">६) जग्गाको श्रेस्ता र फिल्डबुकको प्रमाणित प्रतिलिपि</span></p>', '2017-07-20 04:59:57', '2017-07-20 04:59:57'),
(6, 'घर कायम सिफारिस', '<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">१) घरकायम सिफारिस पाऊ भन्ने सम्बन्धी निवेदन</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">२) नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">३) सम्बन्धित जग्गाको लालपुर्जाको प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">४) स्थलगत प्रतिवेदन</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">५) चालु आ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>', '2017-07-20 05:02:03', '2017-07-20 05:02:03'),
(7, 'घर बाटो प्रमाणित', '<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">१) &nbsp;निवेदन &nbsp;(बाटोको &nbsp;नाम, &nbsp;टोल &nbsp;समेत खुलाउने) नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">२) जग्गाधनी प्रमाण पुर्जाको प्रमाणित प्रतिलिपि</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">३) जग्गा रहेको क्षेत्रको प्रमाणित सक्कलनापी नक्सा</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">५) लिने दिने दुवै व्यक्ति नागरिकताका प्रमाणपत्रको प्रमाणपत्र प्रमाणित प्रतिलिपी सहित उपस्थित हुनु पर्ने वा निजहरुले दिएको अधिकृत वारेसको प्रमाणित प्रतिलिपी</span></p>\r\n<p style=\"box-sizing: border-box; font-size: 17px; line-height: 25px; padding: 10px 0px; margin: 0px; list-style: none; outline: none; border: none; text-align: justify; color: #3f3f3f; font-family: \'Trebuchet MS\', Arial, Helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">६) स्थलगत निरीक्षण प्रतिवेदन</span></p>', '2017-07-20 10:56:08', '2017-07-20 10:56:08'),
(8, 'छात्रबृत्ति सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) घर भएमा चालु आ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद व्यवसाय भएमा व्यवसाय कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) शैक्षिक योग्यताको प्रमाणपत्रको प्रतिलिपि</span></p>', '2017-07-20 12:26:17', '2017-07-20 12:26:17'),
(9, 'विपन्न विद्यार्थी छात्रबृत्ति सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) शैक्षिक योग्यताको प्रमाणपत्रको प्रतिलिपि</span></p>', '2017-07-20 12:28:30', '2017-07-20 12:28:30'),
(10, 'अपाङ्ग सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र र नागरिकता प्रमाणपत्र&divide;जन्मदताको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) कुन प्रकारको शारीरिक अपाङ्गता हो सो सम्बन्धी मेडिकल सुपरीटेन्डेन्टको सिफारिस</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) व्यक्ति &nbsp;स्वंय &nbsp;उपस्थित &nbsp;हुनुपर्ने &nbsp;वा सम्बन्धित कर्मचारीको प्रतिवेदन</span></p>', '2017-07-20 12:30:12', '2017-07-20 12:30:12'),
(11, 'अस्थाई बसोबास सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र र नागरिकता प्रमाण पत्रको प्रतिलिपि र बसोबास गर्ने घर नम्बर, टोल, माग वा बाटोको नाम</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) वहालमा बसेको भए घरधनीको सनाखत मुचुल्का र निजको नागरिकता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) कर्मचारीको हकमा हाल कार्यरत रहेको कार्यालयको पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) घरबहाल कर तिरेका रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) घरबहालको सम्झौता पत्र</span></p>', '2017-07-20 12:30:53', '2017-07-20 12:30:53'),
(12, 'स्थायी बसोबास सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र र नागरिकता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) बसाँई सराईको हकमा बसाई सराई दर्ता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) जग्गाधनी प्रमाणपत्रको प्रतिलिपि</span></p>', '2017-07-20 12:31:21', '2017-07-20 12:31:21'),
(13, 'नागरिकता र प्रतिलिपि सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन &nbsp;पत्र &nbsp;र &nbsp;आमा र बुबाको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जन्म दर्ता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) विवाहित महिलाको हकमा पति र आमा र बुबाको नागरिकता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चारित्रीक प्रमाणपत्रको प्रतिलिपि (बिद्यार्थीको हकमा)</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) विवाह दर्ता प्रमाणपत्रको प्रतिलिपि (बिबाहिताको हकमा)</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) बसाँईसरी आएको हकमा बसाँई सराईको प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) दुवै कान देखिने पासपोर्ट साईजको फोटो २ प्रति</span></p>\r\n<p><span style=\"font-size: 14pt;\">८) चालुआ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण&nbsp;&nbsp;&nbsp; स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">९) कर्मचारी परिवारको हकमा सम्बन्धित कार्यालयको सिफारिस</span></p>\r\n<p><span style=\"font-size: 14pt;\">१०) प्रतिलिपि नागरिकताको हकमा पुरानो नागरिकताको प्रतिलिपि</span></p>', '2017-07-20 12:31:53', '2017-07-20 12:31:53'),
(14, 'अंगिकृत नागरिकता सिफारिस', '<p><span style=\"font-size: 14pt;\">१) &nbsp;निवेदन &nbsp;पत्र &nbsp;र &nbsp;अंगिकृत &nbsp;नागरिकता प्राप्त &nbsp;गर्ने खोजेको स्पष्ट आधार</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) साविक मुलुकको नागरिकता परित्याग गरेको वा परित्याग गर्न कारवाही चलाएको पुष्टि गर्ने कागजातहरु</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) नेपालमा १५ वर्षदेखि कुनै व्यवसाय वा काम गरी वसेको प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) बैबाहिक अंगिकृत नागरिकताका लागि विवाह दर्ता प्रमाणपत्रको प्रतिलिपिर सम्बन्धित देशको आधिकारिक प्रमाणपत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) नेपाली भाषा लेख्न र वोल्न जान्ने प्रमाण कागजातहरु</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) पासपोर्ट साईजको फोटो ३ प्रति</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति करतिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">८) सर्जमिन मुचुल्का</span></p>', '2017-07-20 12:32:53', '2017-07-20 12:32:53'),
(15, 'आर्थिक अवस्था बलियो वा सम्पन्नता प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जग्गाधनी प्रमाण पुर्जा</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) आयश्रोत भए आयश्रोत खुल्ने कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) अन्य आवश्यक कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति करर बहाल कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) सर्जमिन मुचुल्का</span></p>', '2017-07-20 12:33:14', '2017-07-20 12:33:14'),
(16, 'आर्थिक अवस्था कमजोर वा विपन्नता प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) आर्थिक अवस्था कमजोर भएको पुष्टि हुने कागजात</span></p>', '2017-07-20 12:34:32', '2017-07-20 12:34:32'),
(17, 'विद्युत जडान सिफारिस', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जग्गाधनी प्रमाणपत्रको प्रमाणित प्रतिलिपी</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) हक भोगको श्रोत खुल्ने कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) नक्सा पास वा नामसारी नक्सा भएको प्रमाणको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) अन्य आवश्यक कागजातहरु</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>', '2017-07-20 12:35:03', '2017-07-20 12:35:03'),
(18, 'धारा जडान सिफारिस', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नक्सा पास वा नामसारी नक्सा भएको प्रमाणको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) जग्गा धनी प्रमाण पूर्जाको प्रतितिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>', '2017-07-20 12:35:35', '2017-07-20 12:35:35'),
(19, 'जिवित रहेको सिफारिस', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) स्वयं व्यक्ति उपस्थित हुनु पर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) दुई प्रति पासपोर्ट साइजको फोटो</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद कर निर्धारण स्वीकृत भएको कागजात</span></p>', '2017-07-20 12:35:55', '2017-07-20 12:35:55'),
(20, 'दुवै नाम गरेको ब्यक्ति एकै हो भन्ने सिफारिस/फरक जन्म मिति संशोधन सिफारिस', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नाम फरक परेको पुष्टि गर्ने प्रमाणित कागजतहरु</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) सम्बन्धित &nbsp;व्यक्ति &nbsp;वा &nbsp;हकवाला &nbsp;उपस्थित भई सनाखत गर्नु पर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) आवश्यकता अनुसार स्थानीय प्रहरी सर्जमिनका मुचुल्काको प्रतिवेदन माग गर्न सक्ने</span></p>', '2017-07-20 12:36:20', '2017-07-20 12:36:20'),
(21, 'जग्गा मूल्याङकन सिफरिस÷प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जग्गा धनी प्रमाण पुर्जाको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) जग्गाको आसपासको चलन चल्तीको मुल्य प्रक्षेपण</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) हालसालै आसपासको खरिद बिक्री भएको भए सो प्रमाण वा सर्जमिन मुचुल्का</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>', '2017-07-20 12:36:47', '2017-07-20 12:36:47'),
(22, 'ब्यवसाय बन्द सिफारिस', '<p><span style=\"font-size: 14pt;\">१) आफ्नो &nbsp;व्यवसायको &nbsp;विस्तृत &nbsp;व्यहोरा सहितको निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ.व. सम्मको व्यवसाय नवीकरण गरेको प्रमाणपत्रको सक्कल</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) घरबहालसम्झौता पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) स्थलगत प्रतिवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) &nbsp;विदेशीको &nbsp;हकमा &nbsp;परिचय &nbsp;खुल्ने कागजात वा &nbsp; सम्बन्धित दुतावासकोे पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) आफनै घर भएमा चालु आ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>', '2017-07-20 12:37:13', '2017-07-20 12:37:13'),
(23, 'ब्यवसाय सञ्चालन नभएको सिफारिस', '<p><span style=\"font-size: 14pt;\">१) व्यवसाय सञ्चालन नभएको कारण सहितको &nbsp; &nbsp; &nbsp;निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) स्थानीय तहको नाममा व्यवसाय दर्ता गरेको प्रमाणपत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) आफनै घर भएमा चालु आ.व. सम्मको मालपोत र घरजग्गा कर तिरेको रसिद वा कर निर्धारण&nbsp;&nbsp;स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) स्थलगत प्रतिवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) घरबहाल सम्झौता पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) सर्जमिनका मुचुल्का आवश्यक परेमा सो&nbsp;समेत</span></p>', '2017-07-20 12:37:38', '2017-07-20 12:37:38'),
(24, 'ब्यापार ब्यवसाय नभएको सिफारिस', '<p><span style=\"font-size: 14pt;\">१) कारण सहितको निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) &nbsp;स्थानीय &nbsp;तहको &nbsp;नाममा &nbsp;व्यवसाय &nbsp;दर्ता गरेको प्रमाणपत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर&nbsp;निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) सर्जमिनका मुचुल्का आवश्यक परेमा सो समेत</span></p>', '2017-07-20 12:37:59', '2017-07-20 12:37:59'),
(25, 'कोर्ट फि मिनाहा सिफारिस', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) आफ्नै घर भएमा चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) अदालतमा मुद्दा परेका प्रमाण कागजातहरु</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) कोर्ट फी मिनाहा हुनु पर्ने स्पष्ट कारण लिखित रुपमा दिनु पर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) स्थानीय सर्जमिनकामुचुल्का</span></p>', '2017-07-20 12:38:46', '2017-07-20 12:38:46'),
(26, 'नावालक परिचयपत्र सिफारिस', '<p><span style=\"font-size: 14pt;\">१) बाबु आमाको नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जन्म दर्ताको प्रमाणपत्र प्रमाणित प्रतिलिपी</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ.व. सम्मको मालपोत र घर जग्गा&nbsp;कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) नाबालक खुल्ने थप कुनै प्रमाण कागजात भए&nbsp;सो समेत पेश गर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) नावालक अनिवार्य उपस्थित हुनु पर्ने ।</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) दुवै कान देखिने पासपोर्ट साईजको फोटो</span></p>', '2017-07-20 13:08:52', '2017-07-20 13:08:52'),
(27, 'चौपाय सम्वन्धी सिफारिस', '<p><span style=\"font-size: 14pt;\">१) कारण सहितको निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) चौपाया लाने ठाउँको स्वीकृत पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) लिने दिने दुवैले सनाखत गर्नु पर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चौपाया पालन गर्नेका हकमा स्थान र छरछिमेक तथा वाताबरणमा प्रतिकुल प्रभाव नपर्ने व्यहोरा</span></p>', '2017-07-20 13:09:23', '2017-07-20 13:09:23'),
(28, 'ब्यवसाय दर्ता सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) व्यवसाय दर्ता गरेको प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) आप्mनै घर भए चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको</span></p>\r\n<p><span style=\"font-size: 14pt;\">रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) बहालमा भए सम्झौता पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) दुई प्रति पासपोर्ट साइजको फोटो</span></p>', '2017-07-20 13:09:39', '2017-07-20 13:09:39'),
(29, 'उद्योग ठाउंसारी सिफारिस', '<p><span style=\"font-size: 14pt;\">१) <span style=\"font-family: preeti;\">उ<span style=\"font-size: 18pt;\"><strong>Bf]</strong></span>ग</span> ठाउंसारीका लागि निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) </span><span style=\"font-size: 14pt;\"><span style=\"font-size: 14pt;\"> <span style=\"font-family: preeti;\">उ<span style=\"font-size: 18pt;\"><strong>Bf]</strong></span>ग </span></span>दर्ता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) स्थानीय तहको नामको नबिकरण सहितको व्यवसाय दर्ता प्रमाण पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) आपm नै घर भए चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) बहालमा भए सम्झौता पत्रको प्रतिलिपि र बहाल कर तिरेको रसिद&nbsp; <span style=\"font-size: 18pt;\"><strong><span style=\"font-family: preeti;\">/ </span></strong></span>नतिरेको भए तिर्नु बु<strong><span style=\"font-family: mercantile;\">emf</span></strong>उनु पर्ने</span></p>', '2017-07-20 13:13:04', '2017-07-20 13:13:04'),
(30, 'विद्यालय ठाउंसारी सिफारिस', '<p><span style=\"font-size: 14pt;\">१) विद्यालय ठाउंसारीका लागि निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) विद्यालय दर्ता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) स्थानीय तहको नामको नबिकरण सहितको व्यवसाय दर्ता प्रमाण पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) (सरकारी एवं सामुदायिक विद्यालय बाहेक अन्यमा) चालु आ. व. सम्मको सरी जाने ठाउँ र हालको ठाउँ दुवैको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) बहालमा भए सम्झौता पत्रको प्रतिलिपि र बहाल कर तिरेको रसिद&divide;नतिरेको भए तिर्नु बुमmाउनु पर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) स्थायी लेखा नम्बर प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) निरीक्षण प्रतिवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">८) सरी जाने ठाउँको वडा कार्यालयको अनुमति पत्र</span></p>', '2017-07-20 13:13:56', '2017-07-20 13:13:56'),
(31, 'आन्तरिक बसाई सराई सिफारिस', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र &nbsp;निवेदन&nbsp;पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) सरी जाने व्यक्तिहरु नागरीकताको&nbsp; प्रमाणपत्रको प्रमाणित प्रतिलिपि र नागरिकता&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;प्रमाणपत्र नभएको हकमा विवाह दर्ता वा&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;जन्म दर्ता वा उमेर खुलेको निस्साको&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;प्रमाणित प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) जग्गा धनी प्रमाण पुर्जाको प्रतिलिपि &divide;घर वा&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;जग्गा नभएकाको हकमा व्यवसाय वा बसाई&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;खुल्ने प्रमाणकागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) घर जग्गा भएकाको हकमा घर भए चालु &nbsp;&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;आ.व. सम्मको मालपोत र घर जग्गा कर वा&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;एकीकृत सम्पत्ति कर तिरेको रसिद वा कर&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) घर जग्गा नभएकाको हकमा सम्बन्धित घर&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">&nbsp; &nbsp;धनीसँग गरेको घर बहालको सम्झौता</span></p>', '2017-07-20 13:14:23', '2017-07-20 13:14:23'),
(32, 'विद्यालय सञ्चालन स्वीकृत/कक्षा बृद्धि सिफारिस', '<p><span style=\"font-size: 14pt;\">१) विद्यालय कक्षा बृद्धिका लागि निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) विद्यालय दर्ता प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) स्थानीय तहको नाममा चालु आ. व.को नबिकरण सहितको व्यवसाय दर्ता प्रमाण पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) सरकारी बाहेकका विद्यालयका हकमा चालु आ. व.सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) बहालमा भए सम्झौता पत्रको प्रतिलिपि र बहाल कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) निरीक्षण प्रतिवेदन</span></p>', '2017-07-20 13:14:56', '2017-07-20 13:14:56'),
(33, 'ब्यक्तिगत विवरण सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) विषयसँग सम्बन्धित अन्य प्रमाण कागजातहरु</span></p>', '2017-07-20 13:15:17', '2017-07-20 13:15:17'),
(34, 'जग्गा दर्ता सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ. व. सम्मको मालपोत र घर भए घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) साविक लगत प्रमाणित प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) फिल्डबुक उतार</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) स्थलगत निरीक्षण प्रतिवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) जग्गाको नापी नक्सा</span></p>\r\n<p><span style=\"font-size: 14pt;\">८) जग्गासँग सम्बन्धित अन्य प्रमाण कागजातहरु</span></p>\r\n<p><span style=\"font-size: 14pt;\">९) स्थानीय सर्जमिन मुचुल्का</span></p>', '2017-07-20 13:15:35', '2017-07-20 13:15:35'),
(35, 'संरक्षक सिफारिस (ब्यक्तिगत)', '<p><span style=\"font-size: 14pt;\">१) निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) संरक्षक &nbsp;दिने &nbsp;र &nbsp;लिने &nbsp;व्यक्तिको नागरिकता र जन्मदर्ताप्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) आवश्यकता अनुसार स्थलगत सर्जमिन मुचुल्का</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) स्थानीय सर्जमिन मुचुल्का</span></p>', '2017-07-20 13:16:02', '2017-07-20 13:16:02'),
(36, 'संरक्षक सिफारिस (संस्थागत)', '<p><span style=\"font-size: 14pt;\">१) निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) संस्थाको नवीकरण सहितको प्रमाणपत्रको प्रतिलिपि एवं विधानको प्रतिलिपि वा नियमावलीकोे प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद,</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) बहालमा भए सम्झौता पत्र प्रतिलिपि र बहाल कर तिरेको रसिद&divide;नतिरेको भए तिर्नु बुमmाउनु पर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) आवश्यकता अनुसार सर्जमिन मुचुल्का</span></p>', '2017-07-20 13:16:21', '2017-07-20 13:16:21'),
(37, 'नेपाल सरकारको नाममा बाटो कायम सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जग्गाधनी प्रमाणत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) नापी नक्सा</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ.व. सम्मको मालपोत र घर भए घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद ।</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) जग्गाधनीको स्वीकृतिको सनाखत गर्नुपर्ने</span></p>', '2017-07-20 13:16:42', '2017-07-20 13:16:42'),
(38, 'जिवित सँगको नाता प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन तथा नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नाता खुल्ने प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) सर्जमिन गरी बुझ्नु पर्ने भएमा साक्षी बस्ने ७ जनाको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) नाता प्रमाणित गर्ने व्यक्तिहरुको २ प्रति पासपोर्ट साइजको फोटो</span></p>', '2017-07-20 13:17:00', '2017-07-20 13:17:00'),
(39, 'मृतक सँगको नाता प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन तथा नाता खुल्ने प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) हकदारहरुको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) मृत्यु दर्ता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) मृतकको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) हकवाला नावालक भए जन्म दर्ता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) वसाँईसरी आएको हकमा बसाईसराईको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) हकदारहरुको पासपोर्ट साईजको फोटो ४ प्रति</span></p>\r\n<p><span style=\"font-size: 14pt;\">८) स्थानीय सर्जमिन मुचुल्का</span></p>\r\n<p><span style=\"font-size: 14pt;\">९) आवश्यकता अनुसार स्थानीय प्रहरी सर्जमिन मुचुल्का</span></p>', '2017-07-20 13:17:47', '2017-07-20 13:17:47'),
(40, 'कोठा खोल्न कार्य/रोहबरमा बस्ने कार्य', '<p><span style=\"font-size: 14pt;\">१) कारण प्रष्ट खुलेको निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) चालु आ.व. सम्मको घरजग्गा कर , बहाल कर र मालपोत तिरको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) बहाल सम्झौताको प्रमाणित प्रतिलिपी</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) जिल्ला प्रशासन कार्यालयको पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) स्थानीय सर्जमिन मुचुल्का</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) आवश्यकता अनुसार स्थानीय प्रहरी सर्जमिन मुचुल्का</span></p>', '2017-07-20 13:18:06', '2017-07-20 13:18:06'),
(41, 'निःशुल्क वा सःशुल्क स्वास्थ्य उपचार सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन तथा नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) विपन्नता खुल्ने प्रमाण कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) सिफारिस आवश्यक भएको अन्य कारण</span></p>', '2017-07-20 13:18:25', '2017-07-20 13:18:25'),
(42, 'अन्य कार्यालयको माग अनुसार विवरण खुलाई पठाउने कार्य', '<p><span style=\"font-size: 14pt;\">१) निवेदन तथा नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) कार्यालयको पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) विषयसँग सम्बन्धित अन्य कागजातहरु</span></p>', '2017-07-20 13:18:44', '2017-07-20 13:18:44'),
(43, 'संस्था दर्ता सिफारिस', '<p><span style=\"font-size: 14pt;\">१) विधान &nbsp;वा &nbsp;नियमावली, &nbsp;निवेदन &nbsp;र &nbsp;नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) सस्ंथा भाडामा बस्ने भए सम्झौता पत्र र बहाल कर तिरेको रसिद&divide;नतिरेको भए तिर्नु बुमmाउनु पर्ने</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) सस्ंथा आफ्नै घरमा बस्ने भए सोको जग्गाधनी प्रमाण पुर्जा र नक्सा पास प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>', '2017-07-20 13:19:06', '2017-07-20 13:19:06'),
(44, 'चार किल्ला प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निबेदन र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जग्गा धनी प्रमाण पुर्जाको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) जग्गा रहेको क्षेत्रको प्रमाणित प्रतिलिपि नापी नक्सा</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत रघर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) निवेदक स्वयं वा निजले अन्य व्यक्तिलाई तोकेको हकमा निज निवेदकले दिएको अधिकृत वारेसनामाको प्रमाणित प्रतिलिपी</span></p>', '2017-07-20 13:19:54', '2017-07-20 13:19:54'),
(45, 'जन्म मिति प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन र नागरिकता प्रमाण पत्रको प्रतिलिपी</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नाबालकको हकमा जन्म दर्ता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) बसाँई सरी आएको भए सो को प्रमाण पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>', '2017-07-20 13:20:17', '2017-07-20 13:20:17'),
(46, 'विवाह प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) दुलहा दुलहीको नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) बसाँई सरी आएकाको हकमा बसाँई सराई दर्ता प्रमाण पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) दुलाहा दुलही दुबै उपस्थित भई सनाखत गर्नु पर्ने ।</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) वि।स।२०३४ पछिको हकमा बिबाह दर्ता प्रमाण पत्रको प्रतिलिपि</span></p>', '2017-07-20 13:20:37', '2017-07-20 13:20:37'),
(47, 'घर पाताल प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) घरको नक्सा, नक्सा पास प्रमाण पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) स्थलगत निरीक्षण प्रतिवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको घर जग्गा कर वा एकीकृत सम्पत्ति कर र चालु आ.ब. सम्मको मालपोत कर तिरेको &nbsp;रसिद &nbsp;वा &nbsp;कर &nbsp;निर्धारण &nbsp;स्वीकृत &nbsp;भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) आवश्यकता अनुसारसर्जमिन मुचुल्का</span></p>', '2017-07-20 13:21:02', '2017-07-20 13:21:02'),
(48, 'कागज/मञ्जुरीनामा प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन &nbsp;र &nbsp;नागरिकता &nbsp;प्रमाणपत्रको प्रतिलिपि &nbsp;र निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) प्रमाणित गर्नु पर्ने विषय सँग सम्बन्धित प्रमाण कागजहरुको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) मन्जुरीनामा लिने र दिने दुवै व्यक्ति</span></p>', '2017-07-20 13:21:20', '2017-07-20 13:21:20'),
(49, 'हकवाला वा हकदार प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) नागरिकता प्रमाणपत्रको प्रतिलिपि र निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) नाताप्रमाणित प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) हकदार प्रमाणितका लागि स्थलगत सर्जमिन</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) हकदार प्रमाणित गर्ने थप प्रमाण कागज</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) आवश्यकता अनुसारसर्जमिन मुचुल्का</span></p>', '2017-07-20 13:21:36', '2017-07-20 13:21:36'),
(50, 'अविवाहित प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) संरक्षक &nbsp;वा &nbsp;अभिभावकले &nbsp;कार्यालयको रोहबरमा गरेको सनाखत पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) स्थानीय सर्जमिन मुचुल्काको पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) बिदेशमा &nbsp;रहेकाको &nbsp;हकमा &nbsp;विदेशस्थित नेपाली नियोगबाट आएको सिफारिस</span></p>', '2017-07-20 13:22:49', '2017-07-20 13:22:49'),
(51, 'जग्गा रेखांकनको कार्य/सो कार्यमा रोहबर', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) सम्बन्धित कार्यालयको पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) प्राबिधिक प्रतिवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>', '2017-07-20 13:32:21', '2017-07-20 13:32:21'),
(52, 'जग्गा धनीपूर्जा हराएको सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) चालु आ. व. सम्मको मालपोत र घर भए घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) जग्गा धनी प्रमाण पुर्जाको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) निवेदकको &nbsp;स्थायी &nbsp;वतन &nbsp;जग्गा &nbsp;रहेको वडाको नभएमा स्थानीयसर्जमिन मुचुल्का</span></p>', '2017-07-20 13:40:45', '2017-07-20 13:40:45'),
(53, 'पुर्जामा घर कायम गर्ने सिफारिस', '<p><span style=\"font-size: 14pt;\">१) निवेदन र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) भवन नक्शा पास प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) निर्माण सम्पन्न प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद वा कर निर्धारण स्वीकृत भएको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) जग्गा धनी प्रमाण पुर्जाको प्रतिलिपि</span></p>', '2017-07-20 13:41:04', '2017-07-20 13:41:04'),
(54, 'अंग्रेजी सिफारिस तथा प्रमाणित', '<p><span style=\"font-size: 14pt;\">१) निवेदन र नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) विषय सँग सम्बन्धि प्रमाण कागजातको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ. व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>', '2017-07-20 13:41:24', '2017-07-20 13:41:24'),
(55, 'मिलापत्र कागज / उजुरी दर्ता', '<p><span style=\"font-size: 14pt;\">१) मिलापत्र गर्ने दुवै पक्षको संयुक्त निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) सम्बन्धित &nbsp;व्यक्तिहरुको &nbsp;नागरिकता प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) विषयसँग सम्बन्धित अन्य कागजातहरु</span></p>', '2017-07-20 13:41:46', '2017-07-20 13:41:46'),
(56, 'एकिकृत सम्पत्ति कर / घर जग्गा कर', '<p><span style=\"font-size: 14pt;\">१) निवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) जग्गा धनी प्रमाण पुर्जाको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) भवन &nbsp;नक्शा &nbsp;स्वीकृति &nbsp;प्रमाण &nbsp;पत्र &nbsp;र &nbsp;नक्शाको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) भवन/जग्गा खरिद गरेको भए मालपोतबाट रजिष्ट्रेशन पारित लिखतको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) (स्थानीय तहको नाम) घोषणा हुनु पूुर्व निर्माण भएका भवनका हकमा नापी नक्शा वा स्थलगत प्राविधिक प्रतिवेदन</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) मालपोत तिरेको रसिद&nbsp;</span></p>\r\n<p><span style=\"font-size: 14pt;\">७) आ.व. ०५७।५८ पूर्व आन्तिरिक राजश्व कार्यालयमा कर तिरेको भए सो कोे प्रमाणित प्रतिलिपी</span></p>\r\n<p><span style=\"font-size: 14pt;\">८) नागरिकता र नापी नक्साको प्रमाणित प्रतिलिपी</span></p>', '2017-07-20 13:42:08', '2017-07-20 13:42:08'),
(57, 'बहाल कर', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) बहाल सम्झौता</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) नेपाल सरकारमा बहाल सँग सम्बन्धित निकायमा दत्र्ता गरेको प्रमाण पत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) नागरिकताको प्रमाणित प्रतिलिपी</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) चालु आ.व. सम्म घर जग्गा र मालपोत तिरेको रसिदको वा निर्धारण आदेशको प्रमाणित प्रतिलिपी ।</span></p>', '2017-07-20 13:42:30', '2017-07-20 13:42:30'),
(58, 'विज्ञापन कर', '<p><span style=\"font-size: 14pt;\">१) निवेदन र संस्थाको प्रमाणित कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) सम्बन्धित स्थानीय तहमा तिर्न बुझाउन पर्ने व्यवसाय र अन्य करको प्रमाणित प्रतिलिपी</span></p>', '2017-07-20 13:43:14', '2017-07-20 13:43:14'),
(59, 'मालपोत वा भूमीकर', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) प्रथम वर्षका लागि जग्गा धनी प्रमाण पुर्जा, नवीकरणका लागि अघिल्लो आ.व.मा मालपोत तिरेको रसिद वा यस कार्याालयबाट जारी गरिएको मालपोत नवीकरण बुक</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको प्रमाण</span></p>', '2017-07-20 13:43:40', '2017-07-20 13:43:40'),
(60, 'जन्म दर्ता', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) बालकको बाबु&divide;आमाको नागरीकता</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) चालु आ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) अस्पतालमा जन्म भएको हकमा सम्बन्धित अस्पतालले जन्म प्रमाणित गरेको परिचयपत्रको प्रमाणित प्रतिलिपी</span></p>', '2017-07-20 13:44:08', '2017-07-20 13:44:08'),
(61, 'मृत्यु दर्ता', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) मृतकको &nbsp;नागरिकता &nbsp;र &nbsp;सूचना &nbsp;दिन आउनेको नागरीकता</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) मृतक सँग सम्बन्ध जोडिने प्रमाणपत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) अविवाहित मृतकको हकमा स्थानीय सर्जमिन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) मृतकको &nbsp;नागरिकता &nbsp;नभएको &nbsp;हकमा स्थानीय सर्जमिन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) सूचना दिने व्यक्तिको नागरिकता नभएमा समेत स्थानीय सर्जमिन पत्र</span></p>', '2017-07-20 13:44:36', '2017-07-20 13:44:36'),
(62, 'बसाई(सराईजाने / आउने दर्ता)', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र र नागरीकताको प्रमाणपत्रको प्रतिलिपी</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) बसाई सराई गरी जानेको हकमा परिवारको विवरण सहित सम्बन्धित वडा कार्यालय बसाई सराईको कागजात</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) जहाँ जाने हो त्यस ठाउँको लालपूर्जा र जुन ठाउँमा आउनेको पनि पेश गर्नुपर्ने ।</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) बसाई सराई गरी आउनेको हकमा बसाई सराई गरी ल्याएको प्रमाणपत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">५) जाने-आउने सबै व्यक्तिको नागरिकतार जन्मदर्ताको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">६) चालु आ.व. सम्म घर जग्गा र मालपोत कर वा एकीकृत सम्पत्ति कर तिरेको रसिद ।</span></p>', '2017-07-20 13:45:17', '2017-07-20 13:45:17'),
(63, 'सम्बन्ध विच्छेद दर्ता', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) अदालतबाट सम्बन्ध विच्छेद भएको पैmसलाको प्रमाणित प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) पतिपत्नीको नागरीकताको प्रतिलिपि १/१ प्रति</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) केटाको स्थायी ठेगाना सम्बन्धित वडाको हुनु पर्ने ।</span></p>', '2017-07-20 13:45:42', '2017-07-20 13:45:42'),
(64, 'विवाह दर्ता', '<p><span style=\"font-size: 14pt;\">१) निवेदन पत्र</span></p>\r\n<p><span style=\"font-size: 14pt;\">२) दुलाहा&ndash;दुलहीको नागरीकताको प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">३) दुलहीको नागरिकता नभएमा बाबु वा दाजुभाईको नागरीकताको प्रमाणपत्रको प्रतिलिपि</span></p>\r\n<p><span style=\"font-size: 14pt;\">४) चालु आ.व. सम्मको मालपोत र घर जग्गा कर वा एकीकृत सम्पत्ति कर तिरेको रसिद</span></p>', '2017-07-20 13:46:19', '2017-07-20 13:46:19');
